import './base.css';
import React, { useState, useEffect } from 'react';
import { setState, setRotation } from './redux/appSlice';
import { useSelector, useDispatch } from 'react-redux';
import axios from 'axios';
import GoogleMapReact from 'google-map-react';

const apikey = "AIzaSyC9qsxaC4dHG0ibEr9NMKC9Ddro_jdnMk8";


const handleApiLoaded = (map, maps) => {
    console.log("start");

    let pyrmont = new window.google.maps.LatLng(35.4122, 139.4130);
    let callback;
    let mappo = new window.google.maps.Map(document.getElementById('map'), {
        center: pyrmont,
        zoom: 15
    });

    var request = {
        location: pyrmont,
        radius: '500',
        type: ['restaurant']
    };

    let service = new window.google.maps.places.PlacesService(mappo);
    service.nearbySearch(request, callback);

};

function gMap(props) {

    return (
        // Important! Always set the container height explicitly
        <div style={{ height: '100vh', width: '100%' }}>
            <GoogleMapReact
                bootstrapURLKeys={{ key: "AIzaSyC9qsxaC4dHG0ibEr9NMKC9Ddro_jdnMk8" }}
                defaultCenter={props.center}
                defaultZoom={props.zoom}
                yesIWantToUseGoogleMapApiInternals
            >
            </GoogleMapReact>
            <button onClick={({ map, maps }) => handleApiLoaded(map, maps)}></button>
        </div>

    );
}

export default gMap;
